description:
War-torn Europe stands ripped apart by a front line that runs straight through the heart of Germany where American and Western European troops battle against enemy forces. In an eternal war that seems to have no end in sight, opposing forces mercilessly attack each other with unrelenting force, claiming small victories one day only to lose them the next.

This is a 1st/3rd person shooter which is very addictive.  

